import React from "react";
import { Link } from "react-router-dom";


function Navigation() {

  // console.log('Hello')
  return (
    <div class="navbar flex justify-between items-center p-2 font-sans">
      <nav className="bg-slate-800 flex justify-center items-center md:order-2">
        <ul className="flex">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/login">Login</Link>
          </li>
          <li>
            <Link to="/login">Login</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Navigation;
